paper.project.layers[0].removeChildren();

var p    = new paper.Path(),
    size = view.getSize(),
    density = 400;

_.extend( p, { fullySelected: false,  strokeColor: 'black',  strokeWidth: .2 });
//p.dashArray     = [1,1];

//p.add( new Point( -1, size.height / 2 ) );

for (var x = -1, step = 0.0004; x < 1; x += step) {   if (step <= 0) return;
  var y = Math.pow( 4.0 - x * x, 0.1 ) *
        ( Math.sqrt(Math.cos( 1.7*x )) * Math.cos( density*x ) + Math.sqrt(Math.abs(x) ) ),
      real_x = size.width/3 * x + size.width/2,
      real_y = size.height/2 - (y * size.height/6.2);

  p.add( new Point( real_x, real_y ) );
}

